import React from "react";
import "./Regpage.css";
import { Link } from "react-router-dom";
import styled from "styled-components";


const ContainerReg = styled.div`
width: 40%;
margin: 15% 30% 0 30%;
background: white;

`
const Title = styled.p`
text-align: center;
  font-size: 20px;
  padding-top: 15px;
`
const FormReg = styled.form`
width: 60%;
  line-height: 40px;
  margin: 0 20% 0 20%;
`
const Input = styled.input`
float: right;
  margin-top: 10px;
  width: 40%;
`
const Button = styled.button`
width: 20%;
margin: 30px 40% 20px 40%;
height: 30px;
background: rgb(212, 197, 247);
cursor: pointer;
`
const LinkA = styled.p`

`






const Regpage = () => {

  return (
  <ContainerReg> 
  <Title>Sign in</Title>
       <FormReg>
       Email:
       <Input  type="email" placeholder="Email"/>
          <br />
          Password:
          <Input type="password" placeholder="Password"/>
          <br />
          Confirm password:
          <Input type="password" placeholder="Password"/>
          <br />
       </FormReg>
       <Button>Enter</Button>
        <p className="link">
          <Link to="/Login" style={{ textDecoration: "none", color: "black" }}>
            You already have an account
          </Link>
        </p>
     
   
  </ContainerReg>
    
  );
};

export default Regpage;
